import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import History from "./components/History";
import Team1 from "./components/Team1";
import Team2 from "./components/Team2";

function Header() {
    return (
        <header>
            <div className="logo-container">
                <img
                    src="https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG"
                    alt="AC Milan Logo"
                    className="logo-img"
                />
                <span className="logo-text">AC Milan</span>
                <ul className="nav">
                    <li><Link to="/about">Про клуб</Link></li>
                    <li><Link to="/team">Основна команда</Link></li>
                    <li><Link to="/youth">Молодіжна команда</Link></li>
                </ul>
            </div>
            <div className="presentation"></div>
        </header>
    );
}

export default function App() {
    return (
        <Router>
            <Routes>
                <Route path="/about" element={<History />} />
                <Route path="/team" element={<Team1 />} />
                <Route path="/youth" element={<Team2 />} />
            </Routes>
            <div className="wrapper">

            </div>
        </Router>
    );
}
